insert into recipe_texts (recipe_text) values
('Bring rice, water, and salt to a boil in a saucepan. Reduce heat to medium-low, cover, and simmer until rice is
tender and liquid has been absorbed, 20 to 25 minutes.Heat 2 tablespoons sunflower oil in a wok or skillet over
medium-high heat; cook and stir chicken, garlic, and red chile pepper until chicken is golden brown, 5 to 7 minutes.
Stir in curry paste until fragrant, about 1 minute. Add cooked rice and green onions, cooking and stirring for 5 minutes
more. Season with soy sauce.'),
('Push rice mixture to one side of the wok. Heat remaining 1 teaspoon sunflower oil in middle
of wok; cook and stir eggs until just set, about 1 minute. Stir rice mixture into eggs. Sprinkle with peanuts and
cilantro. Serve immediately.Bring the rice and water to a boil in a saucepan over high heat. Reduce heat to medium-low,
cover, and simmer until the rice is tender, and the liquid has been absorbed, 20 to 25 minutes. Spread onto a baking
sheet, and refrigerate 2 hours until cold. Heat a large nonstick skillet over medium heat.'),
('Spray with nonstick cooking spray. Pour eggs into hot skillet. Cook until the eggs begin to set, lifting up the edges
of the set eggs to allow the uncooked egg to contact the hot pan, about 1 minute. Flip omelet in one piece and cook
until fully set, about 30 seconds. Slice omelet into 1/2 inch strips.'),
('Heat the vegetable oil in a wok or large frying pan over high heat. Stir in the onion,
leek, garlic, and chile peppers. Cook, stirring, until onion is soft, 3 to 5 minutes. Stir in the chicken, prawns,
coriander, and cumin, mixing well. Cook and stir for approximately 5 minutes. Mix in the cold rice, sweet soy sauce,
and omelet strips; cook until shrimp are bright pink and chicken is no longer pink in the center, 3 to 5 minutes.'),
